import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';

import FitnessCenterIcon from '@material-ui/icons/FitnessCenter';
import NotificationsNoneIcon from '@material-ui/icons/NotificationsNone';
import TimelineIcon from '@material-ui/icons/Timeline';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';

import { NavLink } from 'react-router-dom';

const useStyles = makeStyles({
  root: {
    width: '100vw',
    position: 'fixed',
    bottom: 0
  },
});

export default function BottomNav() {
  const classes = useStyles();
  const [value, setValue] = React.useState('dashboard');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <footer>
        <NavLink to="/home" activeClassName="activeLink" className="bottomnavitem"><FitnessCenterIcon /></NavLink>
        <NavLink to="/exercises" activeClassName="activeLink" className="bottomnavitem"><FormatListNumberedIcon /></NavLink>
        <NavLink to="/progress" activeClassName="activeLink" className="bottomnavitem"><GroupIcon /></NavLink>
        <NavLink to="/extra" activeClassName="activeLink" className="bottomnavitem"><SettingsIcon /></NavLink>
    </footer>
  );
}
